import React, {Component} from "react";
import button from "./button.jsx";

export default class new_component extends Component {

    render() {
        const groceries = [
            {item : "milk"},
            {item: "eggs"},
            {item: "carrots"},
            {item: "cheese"}
        ];

        return(
            // groceries.map((item) =>
            //     <div><button name={item.item}> </button> </div>
            // )
            [groceries]
        );
    }
}
